import React from 'react';
import { withRouter } from 'react-router-dom';
import './login.scss';
import { Input, Button } from 'antd';
class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      errorName: "ssss",
      errorGender:"",
      errorPhone:"",
      errorEmail:""
    };
  }
  render() {
    // 由于 `this.handleClick` 已经绑定至实例，因此我们才可以用它来处理点击事件
    return (
      <div className="login">
        <div className="header"></div>
        <div className="main">
          <div className="from">
            <Input  placeholder="Name *"/>
            <div className="error">{this.state.errorName}</div>
            <Input  placeholder="Gender *"/>
            <div className="error">{this.state.errorGender}</div>
            <Input  placeholder="Phone *"/>
            <div className="error">{this.state.errorPhone}</div>
            <Input  placeholder="Email *"/>
            <div className="error">{this.state.errorEmail}</div>
            <Button>Sing Up</Button>
            <p></p>
            <div className="Already">
              Already a menbership? log in
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default withRouter(Login);
